class Solution(object):
    def shortestBridge(self, grid):
        """
        :type grid: List[List[int]]
        :rtype: int
        """
        M = len(grid)
        N = len(grid[0])
        DIRECTIONS = ((-1, 0), (1, 0), (0, -1), (0, 1))

        def searchIsland(grid, visited, x, y):
            from collections import deque
            bfs = deque()
            bfs.append((x, y))
            visited[x][y] = 1
            count = 1
            islands = [(x, y)]
            while bfs:
                x, y = bfs.popleft()
                for direction in DIRECTIONS:
                    nx = x + direction[0]
                    ny = y + direction[1]
                    if 0 <= nx < M and 0 <= ny < N:
                        if grid[nx][ny] == 1:
                            if visited[nx][ny] == 0:
                                bfs.append((nx, ny))
                                visited[nx][ny] = 1
                                count += 1
                                islands.append((nx, ny))
            return count, islands

        def doSearch(grid, x, y):
            from collections import deque
            bfs = deque()
            bfs.append(((x, y), 0))
            visited = [[0] * N for _ in range(M)]
            visited[x][y] = 1
            ans = float("inf")
            while bfs:
                (x, y), steps = bfs.popleft()
                for direction in DIRECTIONS:
                    nx = x + direction[0]
                    ny = y + direction[1]
                    if 0 <= nx < M and 0 <= ny < N:
                        if grid[nx][ny] == 0:
                            if visited[nx][ny] == 0:
                                bfs.append(((nx, ny), steps + 1))
                                visited[nx][ny] = 1
                        elif grid[nx][ny] == 2:
                            # update ans
                            ans = min(ans, steps)
            return ans

        def isInside(grid, x, y):
            for direction in DIRECTIONS:
                nx = x + direction[0]
                ny = y + direction[1]
                if 0 <= nx < M and 0 <= ny < N:
                    if grid[nx][ny] == 0:
                        return False
            return True

        # search the larger island
        visited = [[0] * N for _ in range(M)]
        max_count = 0
        larger_islands = None
        for x in range(M):
            for y in range(N):
                if grid[x][y] == 1 and visited[x][y] == 0:
                    count, islands = searchIsland(grid, visited, x, y)
                    if count > max_count:
                        max_count = count
                        larger_islands = islands

        # mark the larger island with number 2
        for island in larger_islands:
            grid[island[0]][island[1]] = 2

        # search from the smaller island
        ans = float("inf")
        for x in range(M):
            for y in range(N):
                if grid[x][y] == 1:
                    if not isInside(grid, x, y):
                        ans = min(ans, doSearch(grid, x, y))
                if ans == 1:
                    break
        return ans


